var page=1;function carregarInfos(){$.ajax({url:`${API_URL}/mobile/agendamentos?page=${page}`,method:"GET",beforeSend:function(a){$(".btn-carregar-infos").html("<i class='fa-solid fa-spinner-third fa-spin'></i>")},success:function(a){if($(".btn-carregar-infos").html("Carregar mais..."),console.log(a.data.length),0==a.data.length)return Toast.fire({text:"Nenhum outro agendamento encontrado",icon:"warning"}),!1;1==page&&($(".agendamento-lista").html(""),$(".agendamento-lista").removeClass("placeholder-wave")),++page,a.data.forEach((a=>{$(".agendamento-lista").append(`<div class="col-12">\n                        <div class="card job-post">\n                            <div class="card-body p-0">\n                                <div class="d-flex align-items-center media-80 text-center bg-warning me-3 rounded">\n                                    <div class="col-12">\n                                        <h3 class="text-white">${moment(a.age_datahora).format("DD")}</h3>\n                                        <span class="text-white">${moment(a.age_datahora).format("MMMM")}</span>\n                                    </div>\n                                </div>\n\n                                <div class="card-info">\n                                    <h6 class="title">${a.pro_nome}</h6>\n                                    <span class="location">${a.esp_nome}</span>\n                                    <span class="text-primary">\n                                        <i class="fa-solid fa-clock"></i>\n                                        ${moment(a.age_datahora).format("HH:mm:ss")}\n                                    </span>\n                                </div>\n                            </div>\n                        </div>\n                    </div>`)}))},error:function(a){$(".agendamento-lista").html(""),Toast.fire({text:a.responseJSON.message,icon:"error"})}})}$((()=>{carregarInfos()}));
